INSERT INTO `product_list` (`product_id`, `product_name`, `product_cat`, `product_desc`, `product_price`, `price_inr`, `price_fc`, `image_filename`, `product_desc1`, `image_filename1`, `image1`, `image2`, `image3`, `image4`, `thumb_image`) VALUES
(0000001, 'Dell Hard Drive', 'computer-accessories', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Product Features</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Wired</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; In-the-ear Headphones</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; In-ear-canalphone Design</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; 10 mm Headphone Driver Units</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Neodymium Magnet </li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; 20 Hz - 20000 Hz Headphone Frequency Response</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; 16 ohm Headphone Impedance</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; 100 dB/mW Headphone Sensitivity at 1 kHz</li>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 5990, 2396, 1797, '', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Product Features</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									 With the digital age rapidly taking over, the need for digital storage turns out to be directly proportional to its growth; the Dell Backup Plus Portable Hard Disk with 1 TB of lavish storage space helps you cope with the digital growth.\n</li>\n								<li style="margin: 0.5em 0em;">\n									 Plug and play backups</li>\n								<li style="margin: 0.5em 0em;">\n									 Easy download to the drive</li>\n								<li style="margin: 0.5em 0em;">\n									 The drive allows you to download videos and your personal data with ease due to the excellent speed of data transfer relying on the high-speed USB 3.0 interface.</li>\n								<li style="margin: 0.5em 0em;">\n									 Easy change of connectivity </li>\n								<li style="margin: 0.5em 0em;">\n									 Change between different interfaces as simple as plugging in an adapter with absolutely no hassle and find your data rates upgraded in minutes. Upgradable to Thunderbolt and Firewire 800, this drives gives you a whole new experience of an incredibly blazing speed.</li>\n								<li style="margin: 0.5em 0em;">\n									 Share your photos and videos on Facebook, Flickr or youTube straight from your drive avoiding the tedious process of copying it onto your computer and then sharing. This Dell portable hard disk aims to make the digital age simpler than ever.</li>\n								<li style="margin: 0.5em 0em;">\n									 Making technology simpler than ever, Dell introduces the Backup Plus external hard disk that is extremely easy to use for both beginners and professionals. Requiring just a basic step of plugging in, this drive demands no prior formatting or installations to begin using it. Drag and drop the files you want to keep safe and the job is done.</li>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>\n', 'images/NEW/dell-hard-drive.jpg', '', '', '', '', 'images/original image/dell-hard-drive.jpeg'),
(0000002, 'Sony portable charger', 'mobile-accessories', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Product Features</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Whole ear is covered</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Lightweight headband enhances comfort and adds durability</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Easy to adjust headband ensures optimum fit and comfort</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Comes with 2 metre-long cable</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Enhanced bass performance</li>\n								\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 1590, 636, 477, 'images1/home/NEW/57.JPG', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Product Features</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									 Power up your smartphone anywhere</li>\n								<li style="margin: 0.5em 0em;">\n                                    With a battery capacity of 2,800 mAh</li>\n								<li style="margin: 0.5em 0em;">\n									 It is compatible with most smartphones and is your perfect companion in providing your smartphone with emergency back-up power.</li>\n                                <li style="margin: 0.5em 0em;">\n									 Anytime with Sony''s entry capacity models of its USB Portable Charger range.</li>\n								\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 'images/NEW/sony-portablecharger.jpg', '', '', '', '', 'images/original image/sony-portablecharger.jpeg'),
(0000003, 'Skullcandy IN-EAR-JIB-WHITE', 'mobile-accessories', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Product Features</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; In-ear-canalphone</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; 3.5 mm Jack</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Stereo Sound and Enhanced Bass</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; 1.3 m Cord Length</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Neodymium Magnet</li>\n								\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 749, 300, 225, 'images1/home/NEW/Skullcandy-IN-EAR-JIB-WHITE-1303533-1-fa72d.jpg', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Product Features</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									 In-ear-canalphone</li>\n								<li style="margin: 0.5em 0em;">\n									 3.5 mm Jack</li>\n								<li style="margin: 0.5em 0em;">\n									 Stereo Sound and Enhanced Bass</li>\n								<li style="margin: 0.5em 0em;">\n									 1.3 m Cord Length</li>\n								<li style="margin: 0.5em 0em;">\n									 Neodymium Magnet</li>\n								\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 'images/NEW/sony-portablecharger.jpg', '', '', '', '', 'images/original image/Skullcandy IN-EAR-JIB-WHITE.jpg'),
(0000005, 'BatMan Origins Game', 'gaming', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							BATMAN ARKHAM KNIGHT (GAMES, PS4)</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">When a terrifying force of evil threatens the very existence of the city you love, you have no other option but to fight the darkness as the darkness by becoming the Batman. A single-player action-adventure video game for the PS4 console, Batman: Arkham Knight is set a year after the events that took place in Batman: Arkham City, the previous installment in the Batman game series. After the death of the Joker, Batman is overwhelmed by the loss of his nemesis and the deep bond that they shared. The citizens of Gotham, however, feel more secure than ever. Seeing this, the Scarecrow decides to make a return to Gotham with a crew of some of the most ruthless villains, i.e., Riddler, Two-Face, Penguin and Harley Quinn. Scarecrow threatens to unleash a whole new strain of a fear toxin. And, that&#8217;s not all. A new villain named the Arkham Knight makes an introduction in this game as well. It is now up to the Caped Crusader to save the innocent citizens of Gotham.</p>\n\n<p style="text-align:justify;">Having received a rating of 16 from PEGI, the gameplay sees the player controlling the Batman in a fashion that is similar to that of the previous installment. You can unleash a barrage of attacks with the use of weapons such as the grapnel gun, the line-launcher and batarangs. The countering system, which allows you to counter enemy attacks, and detective vision, which helps in assessing crime scenes in order to get a lead on the case, enhance your gameplay as well. Batarangs and the line-launcher can be used when you are gliding through the massive open world environment too. A new skill named "Fear Takedown" has been included in Arkham Knight which allows you to defeat up to three enemies simultaneously, however, you have to be undetected for this to work. Time is slowed down after subduing each respective enemy when executing this attack. Hazardous items in the environment, like power generators, can be used to your advantage as they can be made a part of your assault.</p>\n\n<p style="text-align:justify;">Another highlight of this game is that one can use the Batmobile - Batman&#8217;s futuristic car. This vehicle can be summoned whenever needed. One can get speed boosts, perform jumps, rotate on a certain spot, break through objects such as trees and barricades, or even fire missiles when using this advanced car. The Batmobile can be upgraded with new powers through the course of the game, just like Batman.</p>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 2999, 1199, 899, 'images1/home/NEW/batman-arkham-knight-400x400-imadudfknapa7ggf.jpeg', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							BATMAN ARKHAM KNIGHT (GAMES, PS4)</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">If anyone had ever wanted to know how Batman began it all, then Arkham Origins is just the game to play. It serves as a good prequel to the Arkham series of Batman games. The game is developed by Warner Bros. Interactive and will be released for a variety of consoles and the PC as well. The game is based on the DC comicsâ€™ Bruce Wane, the millionaire who takes up crime fighting in the guise of Batman, in order to save his dying city from the clutches of super villains. This particular game is designed for the PS3 and is a Single Player Action Adventure game.\nIn Batman: Arkham Origins, the story focuses more on building a foundation for the Caped Crusader and introducing him to all the characters that matter in the later sequels. The events that transpire in Origins are what sets it apart from the later games in the series. In this game, you will see a younger Batman, still early in his journey to becoming the formidable Dark Knight. As and when the story progresses, you will also see familiar characters coming into the picture. This is a great game to have if you are a Batman fan and will certainly add value to any Dark Knight game collector.</p>\n\n\n<p style="text-align:justify;">Another highlight of this game is that one can use the Batmobile - Batman&#8217;s futuristic car. This vehicle can be summoned whenever needed. One can get speed boosts, perform jumps, rotate on a certain spot, break through objects such as trees and barricades, or even fire missiles when using this advanced car. The Batmobile can be upgraded with new powers through the course of the game, just like Batman.</p>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>\n', 'images/NEW/batman-origins-game.jpg', '', '', '', '', 'images/original image/batman-origins-game.jpeg'),
