(0000016, 'Sony External Hard Drive', 'computer-accessories', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h4 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Sony PlayStation 2 Slim Console (Charcoal Black)</h4>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; High-resolution 2D and 3D graphics</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Inbuilt DVD and CD player</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; 2 controller ports, 2 memory card slots and 2 USB connector ports</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; A network connector, a DC IN connector, an AV multi out connector</li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; A digital out connector  </li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; Dolby Digital AC-3 and DTS sound features  </li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; DUALSHOCK2 Analogue Controller </li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; 294.9 MHz Processor </li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; PAL Video Encoding  </li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; 32 MB RAM  </li>\n								<li style="margin: 0.5em 0em;">\n									>&nbsp; SUPC: SDL055683473 </li>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 4600, 1840, 1380, 'images1/home/NEW/41G3nPL6L5L._SL500_AA300_.jpg', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h4 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Sony PlayStation 2 Slim Console (Charcoal Black)</h4>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									 3x Faster Transfer Speed with Data Transfer Accelerator software</li>\n								<li style="margin: 0.5em 0em;">\n									Other Requirements: 256 MB RAM, Pentium III 450 MHz Processor</li>\n								<li style="margin: 0.5em 0em;">\n									 Operating Temperature : 5Deg C - 40Deg C</li>\n								<li style="margin: 0.5em 0em;">\n									 Storage Temperature : -20Deg C - 60Deg C</li>\n								\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 'images/NEW/sony-hard-drive.jpg', '', '', '', '', 'images/original image/sony-hard-drive.jpeg'),
(0000017, 'Apple iPhone flip cover5s', 'mobile-accessories', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							BATTLEFIELD 4 PS4</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">Battlefield 4 features several changes compared to its predecessor. The game''s heads-up display is much the same, composed of two compact rectangles. The lower left-hand corner features a mini-map and compass for navigation, and a simplified objective notice above it; the lower right includes a compact ammo counter and health meter. The mini-map, as well as the main game screen, shows symbols marking three kinds of entities: blue for allies, green for squadmates, and red/orange for enemies. Players can use dual-scoped weapons, including weapons with different firing modes (e.g. single shots, automatic fire). They can "spot" target&#8217;s-marking their positions to the player''s squad- in the single player campaign (a first in the Battlefield franchise) as well as in multiplayer, allowing teammates to either suppress or eliminate them. In addition, players will have more survival capabilities, such as countering melee attacks from the front while standing or crouching, shooting with their sidearm while swimming, and diving underwater to avoid enemy detection. The single-player campaign will see the player using vehicles to quickly traverse mini-sandbox-style levels.</p>\n\n	</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 799, 320, 240, 'http://men-on.com/images1/home/NEW/battlefield-4-400x400-imadqhfhmpgyutuv.jpeg', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Apple iPhone 5s Flipcover </h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									 Polycarbonate Material</li>\n								<li style="margin: 0.5em 0em;">\n									 Impact Resistant</li>\n								<li style="margin: 0.5em 0em;">\n									Access to all Ports and Controls</li>\n								<li style="margin: 0.5em 0em;">\n									 Protects from Scratches</li>\n								<li style="margin: 0.5em 0em;">\n									 Precise Cutouts</li>\n								\n							</ul>\n	\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>\n', 'images/NEW/amzer-apple-flipcover.jpg', '', '', '', '', 'images/original image/amzer-apple-flipcover.jpeg');
INSERT INTO `product_list` (`product_id`, `product_name`, `product_cat`, `product_desc`, `product_price`, `price_inr`, `price_fc`, `image_filename`, `product_desc1`, `image_filename1`, `image1`, `image2`, `image3`, `image4`, `thumb_image`) VALUES
(0000018, 'HP wireless mouse', 'computer-accessories', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Infamous: Second Son (PS4)</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">Infamous Second Son''s gameplay will be similar to the previous entries, sharing the open world element. Delsin will use the chain wrapped around his arm as his main melee weapon, which will be used in conjunction with other powers that he absorbs throughout the game. One notable change from previous games is that instead of the accessing an aiming system by holding down the L1 button, the player will not need to do so, and will just be able to fire whenever they want, using an on-screen reticle to aim. Parkour returns as a major element, and is executed in the same way; by jumping up walls, Delsin will automatically grab ledges, from which he can hang, pull himself to another ledge, or fire his weapons. The game will also make use of some of the DualShock 4 controller''s new features to enhance gameplay, such as the Touchpad, and the new built-in speaker. Unlike the previous games, multiple power sets will be available to the player. Those known are smoke and neon, the former allowing the game to be played in a fast-paced, chaotic way, while the latter promotes a slower, more precise way of playing. The smoke power entails a variety of unique gameplay elements, such as turning to smoke and dashing through air vents, while neon lets the player rapidly scale any wall. Neither of these features were present in the previous InFamous games.</p>\n\n	</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 995, 398, 298, 'images1/home/NEW/infamous-second-son-400x400-imadr3uhcvnnzxfp.jpeg', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Product Features</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									 2.4 GHz Wireless Connection</li>\n								<li style="margin: 0.5em 0em;">\n									3 Year Domestic Warranty</li>\n															\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 'images/NEW/hp-wireless-mouse.jpg', '', '', '', '', 'images/original image/hp-wireless-mouse.jpeg'),
(0000019, 'Sony smart watch', 'mobile-accessories', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Watch Dogs (PS4)</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">Published by Ubisoft, Watch Dogs is centred on the hacking world of various electronic systems to obtain and control information or to destroy it. Players get to control Aiden Pearce (voiced by Noam Jenkins) a former thug and a brilliant hacker who has witnessed a violent family tragedy due to his criminal past. Players experience the thrill of setting out to hunt down those who have harmed their family and even monitor and hack the surroundings while manipulating the city''s systems to stop traffic lights, turn off the electrical grid and more. This gives players the chance to use the city of Chicago as their ultimate weapon for revenge.\nSynopsis & Feautures: Hack The City - Watch Dogs is all about smart gadgets and having real time control over the city''s infrastructure. Players can manipulate the traffic lights and even trap the enemy in a thirty car pileup. Experience the thrill of having the ability to stop a train, board it to evade the authorities or even escape capture by quickly raising a drawbridge. Players have the advantage of turning anything connected to the city''s Central Operating System (or CtOS) as their weapon. In Street Justice - Living violence is repaid with violence in the inner city of Chicago, where players can take the fight to the streets with their skill. With blows of baton one can even take down enemies delivering devastating defeat or experience a shootout like never before with a physics simulation that rivals anything in the shooter category (get access to more than 30 traditional weapons). With High Octane - Watch Dogs players experience a stable burst with horsepower and get behind the wheel of more than 65 vehicles, each powered with state-of-art physics and handling. Players can even explore the massive city while completing missions. Everything Is Under Control - Disrupt uses advanced processing and graphics to deliver a stunning visual for a realistic experience. This gives players the power to affect or give a twist to the story, the city and the life of the population or throughout the city. With Dynamic Navigation - Watch Dogs players not only get the ability to use the city''s ctOS to their advantage, but the streets as well by cutting through buildings or climbing to the rooftops to catch the target.\n<br/>USP: Watch Dogs introduces players to a whole new world of action and adventure stealth video game.</p>\n\n	</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 14990, 5996, 4497, 'http://men-on.com/images1/home/NEW/watch-dogs-400x400-imadr3uhfvxuap54.jpeg', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Product Features</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									 Black Strap</li>\n								<li style="margin: 0.5em 0em;">\n                                    Square Dial</li>\n								<li style="margin: 0.5em 0em;">\n									 Buckle Clasp</li>\n                                <li style="margin: 0.5em 0em;">\n									 Aluminiu