(0000029, 'Call of Duty Advanced warfare(PS4)', 'gaming', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							CALL OF DUTY: GHOSTS (GAMES, PS4)</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">When the world is threatened by a force of evil a team of elite warriors must unite and do everything within their power to overcome the rising peril. Call Of Duty: Ghosts is a single-player/multiplayer action-adventure first-person shooter video game for the PS4 console. The storyline revolves around Elias and two brothers who are part of a US special operations team. Together, they must track down the perpetrator of a series of heinous crimes, Rorke, who was once a part of the Ghosts, a group consisting of expert agents of warfare. The traitor, Rorke, has set out to kill Ajax who is a part of the Ghosts. Will the brothers and their father Elias be able to prevent the death of Ajax and the chaos and destruction that is being doled out by the terrorists known as the Federation? Or will the world succumb to graver ruin?</p>\n<p style="text-align:justify;">Rated 18 by PEGI for simulated violence and war depictions, CoD''s (Call of Duty) previous releases for the console have inspired a whole new wave of gamers, a cult almost, who can''t help but be immersed by the marvelous storyline and gameplay of this thrilling game. Ghosts, is nothing short of ingenious either. Developed by Infinity Ward and published by Activision, Call Of Duty: Ghosts has an engaging campaign mode where you play as Logan Walker, a battle specialist, for most of the game. However, there are many other playable characters, including Logan''s father, Elias Walker, and an astronaut named Baker.</p>\n<p style="text-align:justify;">The multiplayer mode of this game is nothing like its predecessors as there are new mechanics that have been implemented. There are certain areas on the various maps available that can be changed or destroyed. A few maps house a nuke-like kill streak reward, the ODIN strike, which can be used by eliminating the top player of the other team and accomplishing various challenges once you pick up a briefcase that is dropped. A new game type called Squads, which can be played solo or with other players, along with numerous other multiplayer modes makes CoD: Ghosts an unforgettable gaming experience!</p>\n	</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 4299, 1719, 1289, 'images1/home/call-of-duty-ps4.png', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							CALL OF DUTY: Advanced warfare (GAMES, PS4)</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">For fans who are big into Call of Duty, the sequel to COD Ghosts titled, â€˜Advanced Warfareâ€™, will definitely have you stuck to your monitor screen for hours on end. Not only will you be treated to exo-suits, mech-suits, hover bikes and invisible helicopters, but you also get to hear the voice of Academy Award winning actor, Kevin Spacey, who plays the role of Jonathan Irons, CEO of Atlas Corporation.\n\nFor those who are not aware of the Call of Duty Series, Call of Duty: Advanced Warfare is a first person shooter for the PS4 and is rated Mature by ESRB.\n\nThe game is set in 2054, where most countries including the United States have suffered attacks on their military. However, the largest military force in the world is not a country, but a private military corporation called Atlas. This organization is led by Jonathan Irons (Kevin Spacey) and their plot is take send Private Mitchell (Troy Baker) into remote locations with the most advanced warfare equipment in the business. Fly in invisible helicopters, use long range and short range weapons, heat sensing grenades and mechanical suits as you battle against factions that are fighting for their freedom.\n\nThe game has a Single Player Campaign and a Multiplayer mode. The difference between Advanced Warfare and the last COD game, â€˜COD: Ghostsâ€™, is the type of weapons that are employed. There are a lot of new toys for you to play with in this game. This game is due to be released at the end of the year and many fans around the world are already lip-smacking after the release of the video trailer.\n</p>\n\n							</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 'images/NEW/call-of-duty.jpg', '', '', '', '', 'images/original image/call-of-duty.jpeg'),
(0000030, 'FIFA 15 (PS4)', 'gaming', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							FIFA 14 PS4</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">FIFA 14 is a sports association football simulation video game developed by EA Canada and published by Electronics Arts.\nThe main features are listed below with EA deciding this year to focus more on the online FUT experience. This has come at the expense of features previously enjoyed by gamers, like custom tournament and guest play. A number of users have complained of various bugs and glitches which EA developers hope to eradicate through the normal patching process. The momentum (aka scripting) is also prevalent this year, designed to really add to the excitement of matches around the 45 and 90 minute marks.</p>\n\n	</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 3999, 1599, 1199, 'images1/home/fifa-14-ps4.png', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							FIFA 15 PS4</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">Here is your chance to have the most realistic virtual football experience yet. Rated 3 by PEGI, developed by EA Canada and published by EA Sports, FIFA 15 is a single-player/multiplayer sports association football simulation video game for the PS3 console. FIFA 15 is the latest installment in EAâ€™s FIFA series of football video games. Lionel Messi has been featured on the cover of FIFA 15.</p>\n\n<p style="text-align:justify;">The Next Generation football player was created by the FIFA 15 development team for this game so as to make sure that players look as close to their true physical forms as possible. The physical details of playersâ€™ faces are highly accurate as a new physically-based rendering lighting system has been implemented in FIFA 15. New character models and body rigging make players feel more athletic and powerful.</p>\n\n<p style="text-align:justify;">Boot marks and slide tackles are much more visible on the pitch now. The groundâ€™s surface becomes more weathered as the game progresses as in real football games. The Run Touch Dribbling feature lets you maintain control over the ball even during close-touch situations or while sprinting. The player biomechanics have been upgraded, hence, players will move and react in a balanced manner when they have possession of the ball. The player can perform sharper turns now when moving with the ball at lower speeds. Full-Body Defending is utilized by players to win back possession of the ball and to keep it. Big ball physics, pull/push mechanics, new shoulder barges, fresh character visuals and enhanced cloth technology are among some of the other highlights of this game.</p>\n\n<p style="text-align:justify;">The manner in which players interact with their environment has been revolutionized thanks to the Physically Correct Contacts feature. The movement of the ball is determined by the spin applied on it by an external object such as a body part. Furthermore, players can now take control of others from their team during corners, throw-ins and free kicks.\n</p>\n\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>\n', 'images/NEW/fifa-15.jpg', '', '', '', '', 'images/original image/fifa-15.jpeg'),
(0000031, 'Microsoft wireless mouse', 'computer-accessories', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Need For Speed Rivals (PS4)</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">AllDrive - New in Need for Speed Rivals, AllDrive destroys the line between single player and multiplayer gameplay. Seamlessly join a world where your friends are already racing and chasing. No lobbies. No waiting. Paths will cross as races and pursuits collide, creating a world where no two moments or events will ever be the same.</p>\n<p style="text-align:justify;">High-Stakes Rivalry - Racers are lone wolves out for their own glory; driving agile cars built for high speed racing and epic chases. Cops work in teams to hunt down and bust racers using the full power of the police force. Switch roles at any time and watch the stakes grow in an all-new scoring system that lets you put your speed points on the line to earn even greater rewards.</p>\n<p style="text-align:justify;">Pursuit and Evasion Tech - Intense racing moments are made even more thrilling with access to technology and upgrades customized to each side of the law. Racers can choose evasion technology from jammers to electromagnetic pulses. Cops are outfitted for aggressive busts with shockwaves, roadblocks, helicopter support and more. No matter the side you choose, use technology to keep you one step ahead of your rivals.</p>\n	</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 825, 330, 247, 'images1/home/need-for-speed-rivals.png', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Product Features</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n								<li style="margin: 0.5em 0em;">\n									 Nano Transceiver</li>\n								<li style="margin: 0.5em 0em;">\n									 Quality Performance</li>\n								<li style="margin: 0.5em 0em;">\n									 10 Month Battery Life</li>\n								<li style="margin: 0.5em 0em;">\n									 1 Year Manufacturer Warranty</li>\n								<li style="margin: 0.5em 0em;">\n									 On/Off Switch</li>\n								\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 'images/NEW/microsoft-wireless-mouse.jpg', '', '', '', '', 'images/original image/microsoft-wireless-mouse.jpeg'),
