(0000043, 'Dragon War X Q2 Gaming Keyboard and Mouse Combo USB Standard Keyboard', 'gaming', '', 2665, 1066, 799, '', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Dragon War X Q2 Gaming Keyboard and Mouse Combo USB Standard Keyboard (Red & Black) Price: Rs. 2,790 </h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">Are you looking to upgrade your gaming hardware? Do you want better control and faster response? Then you should \ndefinitely take a look at the Dragon War Q2 keyboard and mouse. Designed for the gamer in you, this keyboard and mouse boasts of cutting-edge technology \nthat is guaranteed to enhance your overall gaming experience.</p>\n\n<p style="text-align:justify;">Semi-mechanical keyboard with quick-access keys and backlight illumination\nThe brilliantly engineered and highly ergonomic Dragon War Q2 keyboard comes with features that make it a multi-functional keyboard. This semi-mechanical keyboard comes with a 19 key roll-over feature that enables you to use multiple keys simultaneously. Also, with the preset multimedia keys, you have easy access to various game functions as well. The keyboard comes with backlighting, which is a useful feature as it allows you to see the keys even in low-light conditions.  The keyboard has been ergonomically designed to provide maximum comfort and convenience even when playing for long hours at a stretch.</p>\n\n<p style="text-align:justify;">Gaming mouse with laser technology and customisable profile \nThe laser technology used in the Q2 mouse is capable of precise tracking with pinpoint accuracy and offers better control. The 3200 dpi gaming laser sensor ensures accurate tracking of all movements, thus paving way for an exceptional gaming experience. Once the device has been installed on your system, you can access the Mouse Tab option to customise the mouseâ€™s profile, scroll speed, lighting, sensitivity and various other functions. The mouse comes with 6 control buttons, each of which can be customised for a desired function, that offer flexibility while gaming. This ergonomically designed mouse offers you comfort even during long playing hours. You can use this mouse without a mouse pad without having to worry about the performance being affected. The durable connecting cord comes with a braided fibre cable and a gold-plated USB connector.</p>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>Gaming mouse with laser technology and customisable profile \nThe laser technology used in the Q2 mouse is capable of precise tracking with pinpoint accuracy and offers better control. The 3200 dpi gaming laser sensor ensures accurate tracking of all movements, thus paving way for an exceptional gaming experience. Once the device has been installed on your system, you can access the Mouse Tab option to customise the mouseâ€™s profile, scroll speed, lighting, sensitivity and various other functions. The mouse comes with 6 control buttons, each of which can be customised for a desired function, that offer flexibility while gaming. This ergonomically designed mouse offers you comfort even during long playing hours. You can use this mouse without a mouse pad without having to worry about the performance being affected. The durable connecting cord comes with a braided fibre cable and a gold-plated USB connector.\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 'images/NEW/dragon-war-x-q2-gaming-keyboard-and-mouse-combo-400x400-imae46s2q74up2gx.jpg\n', '', '', '', '', 'images/original image/dragon-war-x-q2-gaming-keyboard-and-mouse-combo-400x400-imae46s2q74up2gx.png'),
