tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>', 'images/NEW/mad-catz-mmo-tournament-edition-gaming-for-pc-mac-400x400-imae3h88xexzpqwx.jpg', '', '', '', '', 'images/original image/mad-catz-mmo-tournament-edition-gaming-for-pc-mac-400x400-imae3h88xexzpqwx.png'),
(0000046, 'Dragon War ELE-G11 Blue Sensor Mouse(Dark Red) ', 'gaming', '', 799, 319, 239, '', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							BATMAN ARKHAM KNIGHT (GAMES, PS4)</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">Equipped with the blue sensor technology, this gaming mouse is capable of pinpoint tracking precision. \nWin games easily by pinpointing at the target using the laser beams of this mouse. The six control buttons offers the flexibility to\n play any game with ease. Also, it offers four selectable DPI setting - 800, 1200, 2000 and 3200.</p>\n\n\n<p style="text-align:justify;">Equipped with the blue sensor technology, this gaming mouse is capable of pinpoint tracking precision.\n Win games easily by pinpointing at the target using the laser beams of this mouse. The six control buttons offers the flexibility\n to play any game with ease. Also, it offers four selectable DPI setting - 800, 1200, 2000 and 3200.</p>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>\n', 'images/NEW/dragon-war-400x400-imae62rasjqsbzbv.jpg', '', '', '', '', 'images/original image/dragon-war-400x400-imae62rasjqsbzbv.png'),
(0000047, 'Dragon War ELE-G9 Thor Bluetrack with Marco Funtion Mouse Mouse', 'gaming', '', 1370, 548, 411, '', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Dragon War Thor</h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">Designed to survive the most intensive gaming sessions, the mouse is made durable with a strong build. \nIt features an ergonomic design for better grip and is suitable on almost any surface. It also sports a fancy LED light. The device has \na cable length of 1.8 meters and a gold-plated USB connector. </p>\n\n\n<p style="text-align:justify;">The mouse has 8 programmable buttons in total. The buttons are smooth to press and provide accurate feedback.\n The programmable buttons can be assigned specific actions to suit your style of gaming. The mouse also comes with a macro function..</p>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>\n', 'images/NEW/dragon-war-thor-blue-sensor-and-mouse-mat-400x400-imae27hp25qau2dz.jpg', '', '', '', '', 'images/original image/dragon-war-thor-blue-sensor-and-mouse-mat-400x400-imae27hp25qau2dz.png'),
