(0000050, 'Brandpro Macbook Apple Skin-14.1 inch Vinyl Laptop Decal', 'computer-accessories', '', 700, 280, 210, '', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							Brandpro Macbook Apple Skin-14.1 inch Vinyl Laptop Decal (Laptop) Price: Rs. 195 </h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">Transform your laptop to that cool gadget you always wanted. Now stand out among all the other laptop users in your office, college or wherever you go.Brandpro laptop skin is a premium quality vinyl based, laminated and self-adhesive sticker with a unique customized design that reflects the personality of the user or the brand of an organization. It prevents scuff marks and scratches that occur overtime with extensive usage and is durable and easy to maintain. It can also give your old laptop a makeover by giving it a unique look and personality.These skins are stretch resistant, waterproof and come in various designs and colours to suit different individual tastes. Features: stretch proof, water proof, easy to apply and remove (leaves no residue), suitable for both plastic and metal body laptops, aesthetically pleasing to look at, available with screen size from 10.1 inch to 15.6 inch.</p>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>\n', 'images/NEW/13-3-brandpro-macbook-apple-skin-13-3-inch-400x400-imady3csag88frez.jpg', '', '', '', '', 'images/original image/13-3-brandpro-macbook-apple-skin-13-3-inch-400x400-imady3csag88frez.png'),
(0000051, 'SkinShack Apple Sea Blue (14.1 inch) Vinyl Laptop Decal', 'computer-accessories', '', 599, 239, 179, '', '<html>\n	<head>\n		<title></title>\n	</head>\n	<body>\n		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n			<tbody>\n				<tr>\n					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n							SkinShack Apple Sea Blue (14.1 inch) Vinyl Laptop Decal (Laptop) Price: Rs. 194 </h3>\n						<div class="content" style="margin: 0.5em 0px 0em 25px;">\n							\n<p style="text-align:justify;">SkinShack Laptop Skin is a premium quality vinyl based, laminated and self-adhesive sticker with a unique customized design that reflects the personality of the user or the brand of an organization. It is a great yet inexpensive way to make your laptop stand out in the crowd. It can also give your old laptop a makeover by giving it a unique look and personality. It prevents scuff marks and scratches that occur overtime with extensive usage and is Durable and easy to maintain. These Skins Are Stretch Resistant, WaterProof and come in various designs and colors to suit Different Individual tastes. Specialities of SkinShack Skin: Stretch Proof, Water Proof, Easy to Apply and remove (Leaves no residue). Suitable for Both Plastic and metal body laptops. Aesthetically Pleasing to look at. Available in Various Sizes. Pictures Shown above is for reference purpose only. Actual product colours may vary from colours shown on your monitor.</p>\n							</ul>\n						</div>\n					</td>\n				</tr>\n			</tbody>\n		</table>\n		<p>\n			&nbsp;</p>\n	</body>\n</html>\n', 'images/NEW/17-skinshack-apple-sea-blue-17-inch-400x400-imadwzy5ynudwnff.jpg', '', '', '', '', 'images/original image/17-skinshack-apple-sea-blue-17-inch-400x400-imadwzy5ynudwnff.png'),
(0000053, 'Until Dawn', 'gaming', '', 3999, 1599, 1199, '', '<html> 	<head> 		<title></title> 	</head> 	<body> 		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);"> 			<tbody> 				<tr> 					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;"> 						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;"> 							Product Features</h3> 						<div class="content" style="margin: 0.5em 0px 0em 25px;"> 							<ul style="margin: 0px 0px 0px 25px; padding: 0px;"> 								<li style="margin: 0.5em 0em;"> 									Publisher 	Sony Computer Entertainment </li> 								<li style="margin: 0.5em 0em;"> 									Edition 	Standard Edition </li> 								<li style="margin: 0.5em 0em;"> 									Title Name 	Until Dawn  </li> 								<li style="margin: 0.5em 0em;"> 									Genre 	Horror </li> 								<li style="margin: 0.5em 0em;"> 									Game Modes 	Single-Player </li> 								<li style="margin: 0.5em 0em;"> 									Developer 	Supermassive Games Ltd </li> 								<li style="margin: 0.5em 0em;"> 									Platform 	PS4 </li> 								<li style="margin: 0.5em 0em;"> 									PEGI 	18 </li> 								<li style="margin: 0.5em 0em;"> 									Part Number 	4YRJH </li> 								<li style="margin: 0.5em 0em;"> 								Number of Discs 	1 </li> 							 								</ul> 						</div> 					</td> 				</tr> 			</tbody> 		</table> 		<p> 			&nbsp;</p> 	</body> </html>', 'images/NEW/ps4-standard-edition-until-dawn-400x400-imae7fgwgw2wvubk.jpg', '', '', '', '', 'images/original image/ps4-standard-edition-until-dawn-400x400-imae7fgwgw2wvubk.png'),
(0000054, 'Microsoft Flight Simulator X (Steam Edition)', 'gaming', '', 1699, 679, 509, '', '<html> 	<head> 		<title></title> 	</head> 	<body> 		<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);"> 			<tbody> 				<tr> 					<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;"> 						<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;"> 							Microsoft Flight Simulator X (Steam Edition) (for PC) Price: Rs. 1,499 </h3> 						<div class="content" style="margin: 0.5em 0px 0em 25px;"> 							 <p style="text-align:justify;">While driving by an airport, there must have been times when you wondered what it would be like to fly a plane. Seeing the airplane take off can spark a certain feeling of thrill and adventure. What if we told you that you can experience the thrill of flying a plane without having to leave your home? Excited, yes? Microsoft brings to you the updated version of its multiple award-winning flight simulation game, the Microsoft Flight Simulator X. This Steam Edition version is packed with all the realism and challenges one will face while flying. So take to the skies in this crowd favourite flight simulator!</p>   <p style="text-align:justify;">Whatâ€™s new in this update? With an updated multiplayer system and Windows 8.1 support, you can now enjoy this game with your friends and fellow aviation enthusiasts across the world. This game offers a connected world where you can be anything from an air-traffic controller to a pilot or a co-pilot. Also, you can compete against your friends in four different types of races. This game also features the world-famous Red Bull Air Race courses and the unlimited Reno National Championship course. So get ready to conquer the skies with some insane flying. </p>    <p style="text-align:justify;">Wide range of aircrafts and take off destinations You can take control of aircrafts such as the 747 Jumbo Jet, the F/A-18 Hornet, P-51D Mustang and the EH-101 helicopter. You will find that there is an aircraft for every aerial adventure. You can even fly classic planes such as the De Havilland DHC-2 Beaver floatplane and Grumman G-12A Goose. You can select your starting location from more than 24000 airports, set the time, the season and the weather. You can explore a world of aviation beauty in this highly detailed game.   </p>   <p style="text-align:justify;">Immersive gameplay With over 80 missions to test your aerial prowess, you can earn rewards and level up with each level that you complete. You can try your hand at some difficult missions such as the Search and Rescue, Test Pilot and Carrier Operations. Also, the inclusion of AI-controlled jetways, fuel trucks and moving baggage carts, add realism to the experience of flying into and out of busy airports.</p>    <p style="text-align:justify;">Ratings and compatibility This game has a PEGI rating of 3 and can be played on the PC.</p> 							</ul> 						</div> 					</td> 				</tr> 			</tbody> 		</table> 		<p> 			&nbsp;</p> 	</body> </html>', 'images/NEW/pc-microsoft-flight-simulator-x-steam-edition-400x400-imae74hxucufxqyn.jpg', '', '', '', '', 'images/original image/pc-microsoft-flight-simulator-x-steam-edition-400x400-imae74hxucufxqyn.png'),
