(0000076, 'Saitek Pro Flight Multi Panel Gaming Accessory Kit(Black, For PC) ', 'gaming', '', 9990, 3996, 2997, '', '<html>\n 	<head>\n	<title></title>\n 	</head>\n 	<body>\n	<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\n	<tbody>\n	<tr>\n	<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\n	<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\n	Product Features</h3>\n	<div class="content" style="margin: 0.5em 0px 0em 25px;">\n	<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\n		<li style="margin: 0.5em 0em;">Get closer to reality with the Saitek Pro Flight Multi Panel. Enhance your simulation experience with Microsoft Flight simulation X Autopilot display works in real time with Flight Simulator X, removing the need to use fiddly on screen controls. Product Features - A set of switches and LED display for use in controlling various aspects of flight simulation, Full Autopilot panel with associated setting controls, Auto Throttle, Flaps, Elevator Trim wheel, Works with Microsoft Flight Simulator X, Use the dial to adjust frequency units incrementally for quicker selection of your required frequency, Mounts onto the Pro Flight Yoke System (sold separately) or into your own home cockpit setup, Connectivity - USB 2.0, Windows 7, Windows XP, XP64 and Windows Vista (all versions), Works with FSX, FS2004.</li>\n		\n		\n	\n		\n	</ul> 						\n	</div> 					\n	</td> 				\n	</tr> 			\n	</tbody> 	\n	</table> 	\n	<p> 	\n	&nbsp;</p> \n	</body>\n	</html>', 'images/NEW/saitek-pro-flight-multi-panel-400x400-imadzbyjhpwbtw7c.jpg\n', '', '', '', '', 'images/original image/saitek-pro-flight-multi-panel-400x400-imadzbyjhpwbtw7c.png'),
(0000077, 'Saitek Pro Flight Multi Panel Gaming Accessory Kit(Black, For PC) ', 'gaming', '', 31586, 12634, 9475, '', '<html>\r\n 	<head>\r\n	<title></title>\r\n 	</head>\r\n 	<body>\r\n	<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\r\n	<tbody>\r\n	<tr>\r\n	<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\r\n	<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\r\n	Product Features</h3>\r\n	<div class="content" style="margin: 0.5em 0px 0em 25px;">\r\n	<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\r\n		<li style="margin: 0.5em 0em;">The Saitek Pro Flight Yoke System is highly engineered to meet the exacting needs of the true flight simulation enthusiast. Stainless steel shaft, ergonomic controls, integrated chronograph and separate throttle quadrant ensure a smooth, accurate and totally realistic flying experience. Product Features - Durable Stainless Steel shaft with precision bearings gives smooth and predictable elevator and aileron control, Accurately time each leg of your flight plan with the integrated chronograph, Separate throttle quadrant with additional switches to configure any combination of throttle, flaps, mixture or prop pitch. Mount on top, in front of your desk, pilot or co-pilot side so that the controls are exactly where you want them. Unique, 2 - position desk clamp keeps your yoke and quadrant securely fixed no matter how extreme the flying conditions, 14 buttons, POV Hat Switch, 3-position Mode Switch, 3 axis levers on Quadrant, Elevator and Aileron Axes on Yoke, Connectivity - USB 2.0, Windows 7, Windows XP, XP64 and Windows Vista (all versions), Works with FSX, FS2004 and X-Plane.</li>\r\n		\r\n		\r\n	\r\n		\r\n	</ul> 						\r\n	</div> 					\r\n	</td> 				\r\n	</tr> 			\r\n	</tbody> 	\r\n	</table> 	\r\n	<p> 	\r\n	&nbsp;</p> \r\n	</body>\r\n	</html>', 'images/NEW/saitek-pro-flight-yoke-system-400x400-imadp2kyujk7utyb.jpg\n', '', '', '', '', 'images/original image/saitek-pro-flight-yoke-system-400x400-imadp2kyujk7utyb.png'),
(0000078, 'Thrustmaster T.Flight Hotas X(For PC, PS3)', 'gaming', '', 4999, 2000, 1500, '', '<html>\r\n 	<head>\r\n	<title></title>\r\n 	</head>\r\n 	<body>\r\n	<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\r\n	<tbody>\r\n	<tr>\r\n	<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\r\n	<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\r\n	Product Features</h3>\r\n	<div class="content" style="margin: 0.5em 0px 0em 25px;">\r\n	<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\r\n		<li style="margin: 0.5em 0em;">Unique Plug and Play</li>\r\n		<li style="margin: 0.5em 0em;">Trigger</li>\r\n		<li style="margin: 0.5em 0em;">Wide Hand-rest</li>\r\n		<li style="margin: 0.5em 0em;">Multi-directional Hat Switch</li>\r\n		<li style="margin: 0.5em 0em;">4 Pin USB Type A Connector</li>\r\n		<li style="margin: 0.5em 0em;">Dual System Aerodynamic Control</li>\r\n		<li style="margin: 0.5em 0em;">High Precision Joystick</li>\r\n		<li style="margin: 0.5em 0em;">Racing and flight simulator games can get your blood pumping and set your imagination on fire simply with graphics and effects. But the right joystick will transform the experience to something out of this world, with features that enhance your gameplay. The Thrustmaster T.Flight Hotas X is an innovative joystick, incorporating all the features necessary to boost your performance and give you a realistic gameplay.\r\n\r\nThe T.Flight Hotas X joystick is compatible with PC and PlayStation 3 games, offering you a large library of games that support the magic of this joystick. The Thrustmaster controller features a wire that connects to the console through a 4 pin USB Type A connector that is easy to plug-and-play. This means that the Thrustmaster joystick needs no installations when you start playing with it. All the functions for the controls are pre-configured, giving a new meaning to the phrase ''hassle-free gaming''. The wired interface also gives you lag-free gaming, with a seamless connection that will keep you riveted in front of your screen for many hours.\r\n\r\nThis joystick is designed keeping in mind the comfort of the user. The sleek design of the joystick ensemble resembles a real-life rudder from planes, taking you that much closer to the dream cockpit. The real-size and ergonomically designed throttle control is detachable for convenience. The T.Flight Hotas X also features a wide hand-rest that adds comfort to gaming by letting you keep your wrist at rest while you conquer the skies. The base is weighted, giving you unparalleled stability for moments when all your attention is on the flight ahead of you.\r\n\r\nThe high precision joystick features adjustable resistance that provides a realistic feeling to the driving experience. The 12 buttons and 5 axles featured on the Thrustmaster T.Flight Hotas X are completely programmable. You can use the exclusive mapping button to achieve this, as it allows you to reassign the placement of controls, enhancing ergonomics in any game. The Thrustmaster joystick has an internal memory that stores all the programmed customization of the buttons even if the joystick is disconnected.\r\n\r\nThe dual-system aerodynamic control afforded by the joystick is achieved by rotating the handle or progressively tilting the lever. The joystick shaft has an integrated blocking system that promotes precision and realism in gameplay. The joystick has an exclusive preset button that lets you switch instantly from one program to another, even in the middle of a game.\r\n\r\nThe T.Flight Hotas X ensemble sports triggers for brakes in civil flight that can also be used for rapid fire in military flight. The multi-directional hat switch gives you a panoramic view of the scene in front of you, letting you keep an eye on the road behind you and the skies around you for a definite win.</li>\r\n		\r\n	</ul> 						\r\n	</div> 					\r\n	</td> 				\r\n	</tr> 			\r\n	</tbody> 	\r\n	</table> 	\r\n	<p> 	\r\n	&nbsp;</p> \r\n	</body>\r\n	</html>', 'images/NEW/thrustmaster-thrustmaster-t-flight-hotas-x-t-flight-hotas-x-400x400-imade676gje38afk.jpg\n', '', '', '', '', 'images/original image/thrustmaster-thrustmaster-t-flight-hotas-x-t-flight-hotas-x-400x400-imade676gje38afk.png'),
(0000079, 'Thrustmaster T.Flight Hotas X(For PC, PS3)', 'gaming', '', 2540, 1016, 762, '', '<html>\r\n 	<head>\r\n	<title></title>\r\n 	</head>\r\n 	<body>\r\n	<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\r\n	<tbody>\r\n	<tr>\r\n	<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\r\n	<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\r\n	Product Features</h3>\r\n	<div class="content" style="margin: 0.5em 0px 0em 25px;">\r\n	<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\r\n		<li style="margin: 0.5em 0em;">Twist Control</li>\r\n		<li style="margin: 0.5em 0em;">PC Platform</li>\r\n		<li style="margin: 0.5em 0em;">Twist Handle Rudder</li>\r\n		<li style="margin: 0.5em 0em;">Rapid Fire Trigger</li>\r\n		<li style="margin: 0.5em 0em;">Hat Switch</li>\r\n		<li style="margin: 0.5em 0em;">USB Type A 4 pin connector</li>\r\n		<li style="margin: 0.5em 0em;">Bring the excitement of air combat and Grand Prix racing into your living room for a realistic gameplay experience with a joystick that packs performance and style in one neat package. The Logitech Extreme 3D Pro is a precise joystick that enhances your accuracy and takes you to new levels of gaming. The Extreme 3D joystick is compatible with all PC games and will make you the object of your friends'' envy.\r\n\r\nThe 3D Pro joystick connects to your computer with a wire that ends in a USB Type A 4 pin connector. The wired interface gives you lag-free gaming for a seamless experience. This lets you sit at a comfortably distance from your gaming screen while defeating fellow racers too.\r\n\r\nThe streamlined and stylish Logitech joystick is designed with ergonomics in mind. The rudder is convenient to grip and has no protrusions or parts that will hurt your hand. This lets you game for many continuous hours without fatigue or burn-out. The curve on the bottom of the rudder is a convenient hand rest when you''re playing, adding to the allure of this controller. The Extreme 3D Pro has a wide base that makes the joystick stable when you''re playing high-adrenaline shooting or flying games.\r\n\r\nThe Pro joystick features 12 conveniently-placed controls that are easy to reach and actuate in the middle of a power-packed game. 6 of these controls are featured on the base, to be used by one free hand while the other uses the joystick rudder. The other 6 are featured on the rudder, and consist of a trigger, a hat switch and 4 control buttons.\r\n\r\nThe eight-way rubberized hat switch gives you precision control over your on-screen character and keeps you ahead in the game. The twist-handle rudder also gives additional direction control, with accurate zeroing-in for aiming in FPS and flight simulation games.\r\n\r\nThe Logitech Extreme 3D Pro has a rapid-fire trigger that is a favorite among hardcore and professional gamers. This control lets you achieve hits and scores on auto-repeat by shooting limitless bullets at your opponents. Score faster and better against online gamers with this versatile joystick.\r\n\r\nThe Logitech gaming software can be used when you''re using this Extreme 3D joystick for advanced button customization. This feature lets you use multiple controller configurations and printable gaming profiles that lets you up the quality of your performance. The Extreme 3D Pro joystick is compatible with Windows 98, 2000, Me, XP, Vista and Mac OS 9 or later operating systems, letting you explore a large library of racing and shooting games with one accessory.</li>\r\n		\r\n		\r\n	</ul> 						\r\n	</div> 					\r\n	</td> 				\r\n	</tr> 			\r\n	</tbody> 	\r\n	</table> 	\r\n	<p> 	\r\n	&nbsp;</p> \r\n	</body>\r\n	</html>', 'images/NEW/logitech-logitech-extreme-3d-pro-joystick-joystick-400x400-imadbgfhwuj4pt4j.jpg\n', '', '', '', '', 'images/original image/logitech-logitech-extreme-3d-pro-joystick-joystick-400x400-imadbgfhwuj4pt4j.png'),
(0000080, 'Thrustmaster T.Flight Hotas X(For PC, PS3)', 'gaming', '', 5999, 2399, 1799, '', '<html>\r\n 	<head>\r\n	<title></title>\r\n 	</head>\r\n 	<body>\r\n	<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\r\n	<tbody>\r\n	<tr>\r\n	<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\r\n	<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\r\n	Product Features</h3>\r\n	<div class="content" style="margin: 0.5em 0px 0em 25px;">\r\n	<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\r\n		<li style="margin: 0.5em 0em;">PS3 Compatible</li>\r\n		<li style="margin: 0.5em 0em;">Motion Sensors</li>\r\n		<li style="margin: 0.5em 0em;">Motion Controller</li>\r\n		<li style="margin: 0.5em 0em;">Vibration Function</li>\r\n		<li style="margin: 0.5em 0em;">Rechargeable Li-ion Battery</li>\r\n		<li style="margin: 0.5em 0em;">RGB LED</li>\r\n		<li style="margin: 0.5em 0em;">Colour-changing Sphere</li>\r\n		<li style="margin: 0.5em 0em;">Name 	Sony Move Motion Controller PS3 </li>\r\n		<li style="margin: 0.5em 0em;">Interface 	Wireless </li>\r\n		<li style="margin: 0.5em 0em;">Brand 	Sony </li>\r\n		<li style="margin: 0.5em 0em;">Category 	Motion Controller </li>\r\n		<li style="margin: 0.5em 0em;">Model 	Playstation Move </li>\r\n		<li style="margin: 0.5em 0em;">Platform 	PS3 </li>\r\n		<li style="margin: 0.5em 0em;">Color 	Black </li>\r\n		\r\n		\r\n	\r\n		\r\n	</ul> 						\r\n	</div> 					\r\n	</td> 				\r\n	</tr> 			\r\n	</tbody> 	\r\n	</table> 	\r\n	<p> 	\r\n	&nbsp;</p> \r\n	</body>\r\n	</html>', 'images/NEW/sony-sony-move-motion-controller-ps3-move-motion-controller-400x400-imadbf33uwkh6n9s.jpg\n', '', '', '', '', 'images/original image/sony-sony-move-motion-controller-ps3-move-motion-controller-400x400-imadbf33uwkh6n9s.png'),
(0000081, 'Sports Champions 2 (Move Required)(Games, PS3)', 'gaming', '', 1499, 600, 450, '', '<html>\r\n 	<head>\r\n	<title></title>\r\n 	</head>\r\n 	<body>\r\n	<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\r\n	<tbody>\r\n	<tr>\r\n	<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\r\n	<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\r\n	Product Features</h3>\r\n	<div class="content" style="margin: 0.5em 0px 0em 25px;">\r\n	<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\r\n		<li style="margin: 0.5em 0em;">Playing sports is one of the best ways to have a good workout session. However, various priorities in our daily life donâ€™t let us take out the time deserved for the sports we like. Thatâ€™s where Sports Champions 2 comes in. Featuring a variety of physical sports such as Tennis, Golf and others, you can play any sporting event, anytime you want. Jump into a game and find out how you can have a great exercise routine from the comfort of your home. Sports Champions 2 gives you a chance to do this and a lot more. </li>\r\n		<li style="margin: 0.5em 0em;">The sequel to the highly popular Sports Champions, Sports Champions 2 adds many new games that are fun to play with everyone in your family. Targeted towards casual gamers, the sports video game offers new features that will get you addicted to the game as soon as you slide it into your gaming console. Sports Champions 2 Blu-Ray Disc is available on the PS3 platform and carries an E10+ rating from ESRB.</li>\r\n		<li style="margin: 0.5em 0em;">ynopsis and Features\r\n\r\nHit the bullseye while playing Archery; slide down the icy mountains as you ski screaming your name or admire your perfect shot as you see the golf ball land perfectly into the winning hole. Sports Champions 2 includes all these sports that give you the opportunity to create various memorable moments in the game. The added benefit of the game is that you can shape your body while playing your favourite sport. What more are you waiting for? Pick up your Move controller and jump into the exciting and entertaining world of Sports Champions 2.</li>\r\n		<li style="margin: 0.5em 0em;">Developed by San Diego Studio with additional creative input from Zindagi Games and published by Sony Computer Entertainment, Sports Champions 2 can be the perfect addition to your gaming collection. Sports Champions 2 requires the PlayStation Move controller to play all the sports in the game accurately. The controller helps in precisely measuring your hand and body movements to match them with your on-screen animations.\r\n\r\nThe single-player campaign will give you access to 5 new games that include Skiing, Tennis, Boxing, Golf and Bowling, along with an enhanced version of Archery. The sports are fun to play as you interact with your in-game character using the Move controller. This allows you to play the game as you want, increasing the interactivity in the game.</li>\r\n		<li style="margin: 0.5em 0em;">Customization can multiply the fun element in any game. In Sports champions 2, you can create a new player, choose new outfits, select different animations and do many other things. If you feel like you have scored a really high score in a sporting event, you can share your photos online by clicking pictures using an in-game application.\r\n\r\nYou can share the fun of playing these sports with your friends or office buddies when you invite them home as Sports Champions 2 supports multiplayer. By hosting competitions and tournaments through the Party Play mode, you can challenge anyone who plays the game. Up to 4 players can play the game by switching on the game anytime they want.</li>\r\n		<li style="margin: 0.5em 0em;">Buying Guide\r\n\r\nTo enjoy the game to the maximum, a minimum distance of 6 ft is essential between the gamers and the PS3 camera for smooth game play. You will require more space if extra players join in to play the game. Placing the gaming console in a living room or the main hall will give you more freedom for your hand and body movements. It is advised to keep the playing room brightly lit as it will help the camera to easily track and capture your body movements.</li>\r\n		\r\n		\r\n	\r\n		\r\n	</ul> 						\r\n	</div> 					\r\n	</td> 				\r\n	</tr> 			\r\n	</tbody> 	\r\n	</table> 	\r\n	<p> 	\r\n	&nbsp;</p> \r\n	</body>\r\n	</html>', 'images/NEW/sports-champions-2-move-required-400x400-imae87dxehd9zstu.jpg\n', '', '', '', '', 'images/original image/sports-champions-2-move-required-400x400-imae87dxehd9zstu.png'),
