(0000088, 'Need For Speed: Most Wanted - 2012(Games, PS3)', 'gaming', '', 1999, 800, 600, '', '<html>\r\n 	<head>\r\n	<title></title>\r\n 	</head>\r\n 	<body>\r\n	<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\r\n	<tbody>\r\n	<tr>\r\n	<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\r\n	<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\r\n	Product Features</h3>\r\n	<div class="content" style="margin: 0.5em 0px 0em 25px;">\r\n	<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\r\n		<li style="margin: 0.5em 0em;">When your heart constantly needs to be subjected to unrestricted thrills and the only way you can achieve them is by hitting the accelerator as hard as you can and zipping through the streets in a car, you know that you have a need for speed. Need For Speed: Most Wanted - 2012 is a single-player/multiplayer racing game for the PS3 console. Re-released with twice the action and finesse, this spectacular racing game has received a rating of 7 from PEGI.</li>\r\n		<li style="margin: 0.5em 0em;">Developed by Criterion Games and published by Electronic Arts, Need For Speed: Most Wanted - 2012 runs on a Chameleon engine. The premise of the story is the same as it was before, but the way that it has been portrayed in this reboot is far more intense. There are a few racing crews who torment the city by indulging in high-speed races in bodacious supercars. However, the police cannot tolerate this and hence try and chase them down with the hope to capture and put the drivers behind bars.</li>\r\n		<li style="margin: 0.5em 0em;">Most Wanted allows the player to select one kind of car out of the marvelous lot and take part in one of three types of events, i.e., a Sprint race (a race from one side of the city to another), a Circuit race (a race which requires you to make a couple laps around a set course), and a Speed run (a race where the driver with the highest average speed through the course of the track wins). This game uses the competition-between-friends system called Autolog. With an incredible multiplayer experience and numerous grand, high-performance cars waiting to be taken for a spin, this game offers much to the speed junkie.</li>\r\n		\r\n		\r\n	\r\n		\r\n	</ul> 						\r\n	</div> 					\r\n	</td> 				\r\n	</tr> 			\r\n	</tbody> 	\r\n	</table> 	\r\n	<p> 	\r\n	&nbsp;</p> \r\n	</body>\r\n	</html>', 'images/NEW/need-for-speed-most-wanted-2012-400x400-imadcr9krd3nrbgx.jpg\n', '', '', '', '', 'images/original image/need-for-speed-most-wanted-2012-400x400-imadcr9krd3nrbgx.png');
