(0000089, 'Tom Clancy''s Splinter Cell: Blacklist(Games, PC)', 'gaming', '', 1499, 600, 450, '', '<html>\r\n 	<head>\r\n	<title></title>\r\n 	</head>\r\n 	<body>\r\n	<table border="0" cellpadding="0" cellspacing="0" style="font-family: ''Roboto'', sans-serif; background-color: rgb(255, 255, 255);">\r\n	<tbody>\r\n	<tr>\r\n	<td class="bucket normal" style="font-size: 14px; padding: 5px 0em;">\r\n	<h3 style="color:#FE980F; font-size: 14; margin: 0px 0px 0.25em;">\r\n	Product Features</h3>\r\n	<div class="content" style="margin: 0.5em 0px 0em 25px;">\r\n	<ul style="margin: 0px 0px 0px 25px; padding: 0px;">\r\n		<li style="margin: 0.5em 0em;">Fans of Splinter Cell are eagerly waiting to reprise the role of Sam Fisher, a secret operative that reports only to the President of the United States of America. Even though the United States has military presence all around the world, some missions just cannot be carried out by the book. That is when Sam Fisher and his newly formed Fourth Echelon unit come into play. This clandestine team of operatives must avert disaster and help guide Fisher through the missions with vital information.</li>\r\n		<li style="margin: 0.5em 0em;">This version of the Tom Clancy''s Splinter Cell Blacklist is developed for the personal computer running Microsoft Windows operating system by Ubisoft Toronto and published by Ubisoft. The LEAD engine or Unreal Engine 2.5 as it is unofficially known is used as the platform to run the game. Blacklist can be played in single-player, multiplayer and co-op modes allowing you different gameplay options. This action adventure game involves you using your stealth skills to takeout enemy units without drawing attention to yourself.</li>\r\n		<li style="margin: 0.5em 0em;">After the events of the last game in the series, President Caldwell officially terminates the corrupt Third Echelon and all its operations around the world. The newly-formed Fourth Echelon is led by Sam Fisher and comprises of elite operatives brought together from different agencies. Their objective is to operate in a mobile environment and travel the world executing clandestine missions authorized the President. A group of rogue countries initiate a terror ultimatum called Blacklist against the U.S of A. The countdown will trigger a deadly series of terrorist attacks on U.S interests and cause mass destruction of both life and property. The President orders Sam and his elite team of operatives to hunt down the terrorists by any means necessary and prevent the Blacklist countdown from reaching zero.</li>\r\n		<li style="margin: 0.5em 0em;">Get on the mission with Sam in his tactical suit and goggles to hunt down the members of the Blacklist and use ruthless interrogation methods to extract vital information from captured enemies. Acting above the law and with very little time, Sam has to figure out the clues with the help of his elite tactical team which includes Anna Grim Grimsdottir as technical operations manager, Charlie Cole as the resident hacker and CIA operative Issac Briggs, who brings his expertise with weapons to the table. Travel between exotic locations and US cities to find out who is behind the Blacklist countdown. The Paladin is a re-purposed stealth airliner that allows Sam and his team to be a fully mobile unit. With unlimited resources and cutting edge technology, the Fourth Echelon is the last line of defense against unknown enemies.</li>\r\n		<li style="margin: 0.5em 0em;"> The Strategic Mission Interface (SMI) keeps Sam and his team informed of terrorist attacks in real time and keeps them updated while they are on the move. Use the SMI to access the money you earn by completing missions and objectives to upgrade your weapons and gear. The new Kill in Motion feature lets Sam strike lethal blows with precision by marking and executing enemy units in a single fluid motion. Use new and upgraded gadgets to get vital information about enemy whereabouts and plan your action accordingly. Use the upgraded snake cam and micro tri-rotor drone to scout ahead in order to mark enemy agents to execute. Use the curved and brutal Karambit knife to kill enemy units in close quarter encounters. The game is yet to be released and the rating is also pending.\r\n\r\n </li>\r\n		\r\n		\r\n	\r\n		\r\n	</ul> 						\r\n	</div> 					\r\n	</td> 				\r\n	</tr> 			\r\n	</tbody> 	\r\n	</table> 	\r\n	<p> 	\r\n	&nbsp;</p> \r\n	</body>\r\n	</html>', 'images/NEW/tom-clancy-s-splinter-cell-blacklist-400x400-imadfj76utspk4gc.jpg\n', '', '', '', '', 'images/original image/tom-clancy-s-splinter-cell-blacklist-400x400-imadfj76utspk4gc.png'),
