(0000114, ' JBL T250SI On-the-ear Headphone (On the Ear) ', 'deal products', NULL, 999, 400, 300, NULL, '<b>Key Features of JBL T250SI On-the-ear Headphone </b></br>\r\n\r\n    Supra-aural Closed Headphone </br>\r\n    On-the-ear Headphone </br>\r\n    Over-the-head Design </br>\r\n    Wired Connectivity </br>\r\n\r\n<b>JBL T250SI On-the-ear Headphone</b> </br>\r\n\r\nWhether you long for high-energy tunes to spice up your workout sessions at the gym or want to listen to songs while you are on the go, this pair of headphones from JBL is something you might need.', 'images/NEW/jbl3.png', 'images/NEW/jbl4.png', 'images/NEW/jbl2.png', 'images/NEW/jbl1.png', 'images/NEW/jbl5.png', NULL),
(0000115, 'Samsung Evo 32 GB MicroSDHC Class 10 48 MB/s Memory Card', 'deal products', NULL, 569, 228, 171, NULL, '<b>Key Features of Samsung Evo 32 GB MicroSDHC Class 10 48 MB/s Memory Card</b></br>\r\n\r\n   . Class 10 Memory Card</br>\r\n    . UHS-1 Enabled</br>\r\n    . Transfer 360 Photos per Minute</br>\r\n   . Survive Upto 24 hrs in Seawater</br>\r\n    . 16 GB MicroSDHC Memory Card</br>\r\n    . Protect Precious Data from Damage Caused by Airport X-ray Machines</br>\r\n    . Resist Upto 13 Times the Magnetic Force of Home Theatre Speakers</br>\r\n\r\n', 'images/NEW/sam1.png', 'images/NEW/sam2.png', 'images/NEW/sam3.png', 'images/NEW/sam4.png', '', NULL),
(0000116, 'Philips BT3200/15 Corded Beard Trimmer for Men', 'deal products', NULL, 949, 380, 285, NULL, '\r\n<b>Key Features of Philips BT3200/15 Corded Beard Trimmer for Men</b></br>\r\n\r\n   . Corded Trimmer</br>\r\n   . Easy Handle Grip</br>\r\n   . 1 mm Precision Settings</br>\r\n   . Ergonomic Design</br>\r\n\r\n', 'images/NEW/phl3.png', 'images/NEW/phl1.png', 'images/NEW/phl2.png', 'images/NEW/phl4.png', 'images/NEW/phl5.png', NULL),
(0000117, ' Logitech MK240 Wireless Keyboard and Mouse Combo', 'deal products', NULL, 1999, 800, 600, NULL, '\r\n<b>Key Features of Logitech MK240 Wireless Keyboard and Mouse Combo</b></br>\r\n\r\n  . OS Supprted: Windows XP and Above</br>\r\n  . Compatible with: computer</br>\r\n<b>Logitech MK240 - Wireless Keyboard and Mouse Combo</b>\r\n\r\nTyping is now a joy and navigating your computer a breeze, thanks to this wireless keyboard and mouse combo from Logitech which will change the way you operate your computer.</br>\r\n<b>Steamlined Shape</b></br>\r\nVividly coloured, possessing a minimalistic, space-saving design and featuring fine contours, this keyboard and mouse are sure to make a lasting impression on all who witness it.</br>\r\n<b>Comfy Keyboard & Mouse</b></br>\r\nYou can type away to your heart''s content on this keyboard as it has sleek keys which are very quiet when used. The mouse is comfortable to grip and use as well.</br>\r\n<b>Sturdy & Seamless to Use</b></br>\r\nBuilt to last, the keyboard of this combo has a spill-resistant design and its tilt legs are pretty durable. Controlling the cursor of the mouse is a breeze as it features high-definition optical tracking and a DPI of up to 1000 - effortlessly perform numerous actions when you''re gaming.</br>\r\n<b>Reliable Wireless Connectivity</b></br>\r\nLogitech''s Advanced 2.4 GHz wireless technology allows you to relay your keyboard-based and mouse-based inputs seamlessly to your computer even when there are multiple wireless devices in your environment.</br>\r\n<b>Long-lasting Battery Life</b></br>\r\nYou don''t have to worry about changing the batteries of this keyboard and mouse. The keyboard''s battery lasts for up to 2 years and the mouse''s battery lasts for up to 1 year. Both peripherals have on/off buttons to ensure better power conservation.</br>\r\n', 'images/NEW/logitech2.png', 'images/NEW/logitech3.png', 'images/NEW/logitech4.png', 'images/NEW/logitech1.png', 'images/NEW/logitech5.png', NULL),
(0000118, ' Philips Bt50w Mobile/Tablet Speaker (White, Single Unit Channel) ', 'deal products', NULL, 1250, 500, 375, NULL, '<b>Key Features of Philips Bt50w Mobile/Tablet Speaker</b></br>\r\n\r\n   . 200-20 KHz Frequency</br>\r\n   . 2 W Power Output</br>\r\n   . USB Chargeable</br>\r\n\r\n<b>General</b></br>\r\nBrand- 	Philips</br>\r\nType- 	Mobile/Tablet Speaker</br>\r\nKey Features -	200-20 KHz Frequency, 2 W Power Output, USB Chargeable</br>\r\nConfiguration- 	Single Unit Channel</br>\r\nModel ID- 	Bt50w</br>\r\nColor- 	White</br>\r\n<b>Power</b></br>\r\nPower Output- 	2 W</br>\r\nPower Source- 	USB Chargeable</br>\r\n<b>Audio Features</b></br>\r\nTotal Power Output RMS (W)- 	2 W</br>\r\nFrequency Response- 	200-20000 Hz</br>\r\n<b>Connectivity</b></br>\r\nMemory Card Slot- 	No </br>', 'images/NEW/philips-bt50w-400x400-imaee3payqhehhrv.png', '', '', '', '', NULL),
(0000119, ' SanDisk Ultra Dual Drive 32 GB Pen Drive (Black) ', 'deal products', NULL, 700, 280, 210, NULL, '\r\n<b>Key Features of SanDisk Ultra Dual Drive 32 GB Pen Drive</b></br>\r\n\r\n   . Case Material: Plastic</br>\r\n   . Interface: USB 3.0</br>\r\n\r\n\r\n<b>SanDisk Ultra Dual Drive 32 GB Pen Drive (Black) Price: Rs. 700</b></br>\r\n\r\nWhy carry your OTG cable and your pen drive, when you can carry this SanDisk Ultra Dual pen drive? With this dual pen drive, you can quickly and easily transfer files between your OTG-enabled phone or tablet and PC.</br>\r\n\r\n<b>Fast</b></br>\r\nThis flash drive not only allows you to transfer files easily but it also allows you to transfer files quickly while on the go. You donÃ¢â‚¬â„¢t need extra cables to transfer files from your PC to smartphone or vice versa.</br>\r\n\r\n<b>Storage Space</b></br>\r\nWith 32GB storage space, you can conveniently store everything you want in this dual drive, from songs to movies, documents to pictures.</br>\r\n', 'images/NEW/san4.png', 'images/NEW/san3.png', 'images/NEW/san1.png', 'images/NEW/san2.png', '', NULL),
(0000120, ' Ambrane P-1310 13000 mAh (White, Black) ', 'deal products', NULL, 999, 400, 300, NULL, '\r\n<b>Key Features of Ambrane P-1310 13000 mAh</b></br>\r\n\r\n   . 13000 mAh Capacity</br>\r\n   . Portable Charger</br>\r\n   . LED Torch</br>\r\n   . Indicator Lights</br>\r\n   . On / Off Button</br>\r\n\r\n<b>Ambrane P-1310 13000 mAh</b></br>\r\n\r\nIs your smartphone or tablet running out of power before the day is over? Get this Ambrane P-1310 13000 mAh Power Bank and keep your gadgets fully charged all the time.</br>', 'images/NEW/amb1.png', 'images/NEW/amb3.png', 'images/NEW/amb2.png', '', '', NULL);
